def get_github_url(file_suffix):
    return f"https://raw.githubusercontent.com/{GITHUB_CONFIG['user']}/{GITHUB_CONFIG['repo']}/{GITHUB_CONFIG['branch']}/{SCRIPT_BASE_NAME}{file_suffix}"

def check_for_updates():
    try:
        response = requests.get(get_github_url(".metadata.json"), timeout=10)
        if response.status_code == 200:
            remote_meta = response.json()
            with open(f"{SCRIPT_BASE_NAME}.metadata.json") as f:
                local_meta = json.load(f)
            return remote_meta["version"] > local_meta["version"]
    except Exception:
        return False
    return False

def perform_update():
    try:
        files = [".metadata.json", ".sha256", "_ready_to_use.py"]
        for suffix in files:
            url = get_github_url(suffix)
            response = requests.get(url, timeout=10)
            if response.status_code == 200:
                with open(f"{SCRIPT_BASE_NAME}{suffix}", 'wb') as f:
                    f.write(response.content)
        return True
    except Exception:
        return False

